window.bookSummaryJSON = "<p><b>An enthralling and inventive thriller, only on Audible</b></p> <p>Thirteen-year-old Emily Poe has been given the opportunity of a lifetime: A chance to attend the exclusive Audyn School in Manhattan. But to win the scholarship, she has to pass a test like nothing she’s ever experienced before: A nearly bare room, a set of strange clues, a locked door. And a mysterious organization - the Leopold Foundation - that’s watching her every move.&nbsp;</p> <p>But the real test has just begun. Despite the strange circumstances - in a new house, at a new school - Emily instantly bonds with fellow scholarship winner Alice Wray.&nbsp;</p> <p>And then Alice goes missing.&nbsp;</p> <p>Chronicling every surprising twist and turn of her search through her own private video diary, Emily sets out to find the truth behind Alice’s disappearance. Soon she’s drawn deep into the inner circle of the Audyn School’s elite, the Nobility, who each have secrets of their own. As clues and lies mount, Emily must sort truth from fiction to solve the Mystery of Alice before it’s too late.&nbsp;</p>"; 
